import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import texture from '../../styles/assets/texture2.gif';
import '../../styles/css/home/Home.css';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <img className="texture" id="texture1" src={texture} alt="texture" />
        <div className="title">
          <p className="name left">Wild</p>
          <p className="name right">Fighter</p>
        </div>
        <div className="Home_animation">
          <div className="Home_button" onClick="">
            <Link to="/selectMap/MapButton">
              <input className="Home_play" type="button" value="PLAY" />
            </Link>
          </div>
        </div>
        <iframe
          title="rocky"
          width="0"
          height="0"
          src="https://www.youtuberepeater.com/watch?v=ov-CGRnyYH0#gsc.tab=0"
          frameborder="0"
          allowfullscreen
        ></iframe>
      </div>
    );
  }
}

export default Home;
